import './App.css';

function App() {
  return (
    <div className="App">
      <table>
        <tr>
        <th colspan="3">NCSA Lab Hours Tracker</th>
        </tr>
        <tr>
          <td>Day</td>
          <td>Name</td>
          <td>Time</td>
        </tr>
      </table>
    </div>
  );
}

export default App;
